import { wrapPromise } from "../promise_wrap.js";

export const fetchSuggestionData = (addendum, search_paradigm) => {
    const genrePromise = fetchSuggestion("http://localhost:8000/api/suggestions/"+search_paradigm+"/"+addendum+"/");
    return  {
        genre: wrapPromise(genrePromise)
    }
}

const fetchSuggestion = () => fetch()
    .then(response => response.json())
    .catch(error => console.trace());
